query Experiences($nextPage: String, $limit: Int!) {
  experiences(after: $nextPage, first: $limit) {
    edges {
      node {
        id
        name
        briefDescription
        description
        categories
        keywords
        themes
        images {
          caption
          originalUrl
          thumbnailUrl
          previewUrl
        }
        videos {
          name
          sourceUrl
          thumbnailUrl
          previewUrl
        }
      }
    }
    pageInfo {
      endCursor
      hasPreviousPage
    }
    totalCount
  }
}

